ALPHABET = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'
ct="_JVYYRB_QFX_PKKEYKVSQJREHA_HD_JZGBMR_FBFG_HG"
n = len(ALPHABET)
m=""
offset=1
for i in range(0,len(ct),5):
    for j in range(5):
        if ct[i+j]=='_':
            m+='_'
        else:
            a=ALPHABET.index(ct[i+j])-offset
            if a<0:
                a+=n
            m+=ALPHABET[a]
    offset = (offset * 3 + 4) % n
print(m)